                            left: "50%",
                            objectFit: "cover",
                            transform: "translate(-50%,-10%)"
                            //zIndex: "-1"
                        }}
                    >
                        <source src={Vikings} type="video/mp4" />
                    </video> */}

                {/* </div> */}
            </Segment>

        </React.Fragment>
    )
}

